description:
大容量300W蓄電源<br>
<br>　
 ソーラーパネル・家庭用コンセントから充電
　ソーラーパネルから充電できるので日のあたる
　ところに置いておけば常に充電されます。
　家庭用コンセントから夜間電力で充電して昼間
　使用することで節電にもなります。<br>
<br>

 出力はAC100VとUSBの2系統<br>
<br>
　家庭用電化製品やモバイル機器の充電等に
　活躍します。
<br>
<br>
 LED照明を内蔵<br>
<br>
　停電時や夜間、本体のみでも光を放ちます。（約100時間）<br>
<br>

 ブレーカー付で安全<br>
<br>
　過電流時や漏電の場合もブレーカーが落ち
　トラブルを未然に防ぎます。<br>
<br>

 電池残量表示<br>
<br>
　電池残量をランプで表示し、残量がなくなると
　音を鳴らし充電を催促します。<br>
<br>

 オプション拡張<br>
<br>
　別売でもうひとつソーラーパネルを拡張すること
　ができます。また、ソーラーパネルと本体をもっと
　距離をおいて使用したい時のために延長コードを
　オプションにて用意しています。
<br>
<br>
パネルは折りたため、
持ち運びにも収納にも
便利です。<style type="text/css">
